--
-- Table structure for table `t_month`
--

DROP TABLE IF EXISTS `t_month`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_month` (
  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `year` smallint(5) unsigned NOT NULL COMMENT 'Ordinal Year of Era',
  `month` tinyint(3) NOT NULL,
  `month_name` varchar(3) NOT NULL,
  `leap_month` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `era_id` smallint(5) unsigned NOT NULL,
  `first` mediumint(8) unsigned NOT NULL,
  `last` mediumint(8) unsigned NOT NULL,
  `ganzhi` char(6) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `start_from` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT 'First Day of Month is which ordinal?',
  `status` enum('S','P') CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT 'S' COMMENT 'S = standard, P= proleptic',
  `eclipse` tinyint(3) NOT NULL DEFAULT '0' COMMENT 'First Day of Month is a Solar Eclipse?',
  PRIMARY KEY (`id`),
  KEY `era_id` (`era_id`),
  KEY `first` (`first`),
  KEY `last` (`last`),
  KEY `first_last_date` (`first`,`last`),
  KEY `month_name` (`month_name`),
  CONSTRAINT `t_month_ibfk_1` FOREIGN KEY (`era_id`) REFERENCES `t_era` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=180799 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

